import Vue from 'vue';
import wrap from '@vue/web-component-wrapper';
import InstagramWidget from './components/InstagramWidget';
import VS2 from 'vue-script2';
import App from './App.vue';
import store from './store';  // Make sure this path is correct


// Import individual components from BootstrapVue
import { BSpinner } from 'bootstrap-vue';

// Register the component globally
Vue.component('b-spinner', BSpinner);

Vue.config.productionTip = false;

new Vue({
    store,  // Provide the store to the Vue instance
    render: h => h(App),
}).$mount('#app');
Vue.use(VS2);

const WrappedElement = wrap(Vue, InstagramWidget);

const fontStyle = document.createElement('style');
fontStyle.textContent = `
@font-face {
  font-family: 'swiper-icons';
  src: url('data:application/font-woff;charset=utf-8;base64,');
  font-weight: 400;
  font-style: normal;
}`;
document.head.appendChild(fontStyle);
console.log('Main.js loaded');
if (!window.customElements.get('instagram-widget')) {
    window.customElements.define('instagram-widget', WrappedElement);
}
